import React from 'react';
import './App.css';
import 'bootstrap/dist/css/bootstrap.min.css';
import { Container, Card,Row,Col } from "react-bootstrap";

function App() {
  return (
    <div className="App">
          <Container>
              <Card>
                <Card.Body>
                <Row>
                <Col style={{"bg-color":"blue"}} sm={8}>sm=8</Col>
                <Col sm={4}>sm=4</Col>
              </Row>
                </Card.Body>
              </Card>
          </Container>
    </div>
  );
}

export default App;
